import useUsers from "../../store/user";
import {useEffect, useState} from "react";
import {key,url,playlist,num} from "../../youtube/api";
import axios from "axios";
function User() {
    const { users, execute} =useUsers(state => state);
    const [a ,setA] =useState([]);
    const [isClick,setIsClick] =useState(false);
    const callApi = (e) => {
        execute(`https://jsonplaceholder.typicode.com/users`)
        setIsClick(true);
    }


    useEffect(() =>{
        axios.get(url).then((res) => {
            setA(res.data.items);
        })


    },[])


    return(
        <div>
            <button onClick={callApi} disabled={isClick}> call api </button>
           <div>
               {users.map((user) =>{
                   return <div>{user.name}</div>
               })}
           </div>

            <div>
                {a.map((a) =>{
                    return <div key ={a.id}>{a.snippet.thumbnails.medium}</div>
                })}
            </div>

        </div>
    )
}

export default  User;
